import React from 'react';
import Gallery from './Gallery';
import Login from './Login';
import Landing from './Landing';
import { Router, Routes, Route } from 'react-router-dom';

const App = () => {
	return (
		<>
			<Router>
				<Navbar id='nav' />
				<Routes>
					<Route path='/gallery' element={<Gallery />} />
				</Routes>
			</Router>
			<Gallery />;
		</>
	);
};

export default App;
